"""
904. Fruit Into Baskets

In a row of trees, the i-th tree produces fruit with type tree[i].

You start at any tree of your choice, then repeatedly perform the following steps:

Add one piece of fruit from this tree to your baskets. If you cannot, stop.

Move to the next tree to the right of the current tree. If there is no tree to the right, stop.

Note that you do not have any choice after the initial choice of starting tree:
you must perform step 1, then step 2, then back to step 1, then step 2, and so on until you stop.

You have two baskets, and each basket can carry any quantity of fruit,
but you want each basket to only carry one type of fruit each.

What is the total amount of fruit you can collect with this procedure?

Example 1:

Input: [1,2,1]
Output: 3
Explanation: We can collect [1,2,1].

Example 2:

Input: [0,1,2,2]
Output: 3
Explanation: We can collect [1,2,2].
If we started at the first tree, we would only collect [0, 1].
Example 3:

Input: [1,2,3,2,2]
Output: 4
Explanation: We can collect [2,3,2,2].
If we started at the first tree, we would only collect [1, 2].
Example 4:

Input: [3,3,3,1,2,1,1,2,3,3,4]
Output: 5
Explanation: We can collect [1,2,1,1,2].
If we started at the first tree or the eighth tree, we would only collect 4 fruits.
 

Note:

1 <= tree.length <= 40000
0 <= tree[i] < tree.length

"""
class Solution(object):
    def totalFruit2(self, tree):
        """
        :type tree: List[int]
        :rtype: int
        """
        # use binary search
        # time: O(Nlog(n)), space: O(N)
        l, r = 1, len(tree)
        lastFound = None

        while l <= r:
            m = (l+r)//2

            # use window size as m, check if there's any window meets the criteria:
            # t in {a, b} for t in tree[i:i+m]

            found = self.verify(tree, m)
            if found:
                lastFound = m
                l = m+1
            else:
                r = m-1

        return lastFound

    # optimized
    def verify(self, tree, m):
        types = {}
        for t in tree[:m]:
            if t not in types:
                types[t] = 1
            else:
                types[t] += 1
        if len(types.keys()) <= 2:
            return True

        j = 1
        while j < len(tree)-m+1:
            tr = tree[j-1]      # tree to remove
            ta = tree[j+m-1]    # tree to add
            
            types[tr] -= 1
            if types[tr] == 0:
                types.pop(tr, None)
                # print "del key: ", tr

            if ta not in types:
                types[ta] = 1
            else:
                types[ta] += 1
            if len(types.keys()) <= 2:
                return True
            j += 1
        return False

    # longest subarray with 2 elements
    def totalFruit(self, tree):
        # time: O(n), space: O(1)
        res = 0
        length = 0
        treeA, treeB = 0, 0
        counter = 0         # count the consecutive number of last seen fruit
        for t in tree:
            if t in (treeA, treeB):
                length += 1
            else:
                length = counter + 1
            if t == treeB:
                # the last seen fruit is as same
                counter += 1
            else:
                # the last seen fruit is different, reset counter
                counter = 1
                treeA, treeB = treeB, t

            res = max(res, length)

        return res
                    

